import React from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import HomeIcon from '@material-ui/icons/Home';
import NewReleasesIcon from '@material-ui/icons/NewReleases';
import SupervisedUserCircleIcon from '@material-ui/icons/SupervisedUserCircle';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import SettingsIcon from '@material-ui/icons/Settings';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';

const useStyles = makeStyles((theme) => ({
  sidebar: {
    backgroundColor: '#2c3e50',
    width: 200,
    padding: '20px 0',
  },
  sidebarListItem: {
    padding: '10px 20px',
    color: '#ecf0f1',
    cursor: 'pointer',
  },
  sidebarListItemIcon: {
    minWidth: '40px',
  },
}));

function Sidebar() {
  const classes = useStyles();

  return (
    <div className={classes.sidebar}>
      <List>
        <Link to="/">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <HomeIcon />
            </ListItemIcon>
            <ListItemText primary="Home" />
          </ListItem>
        </Link>
        <Link to="/latest-news">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <NewReleasesIcon />
            </ListItemIcon>
            <ListItemText primary="Latest News" />
          </ListItem>
        </Link>
        <Link to="/get-advise">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SupervisedUserCircleIcon />
            </ListItemIcon>
            <ListItemText primary="Get Advise" />
          </ListItem>
        </Link>
        <Link to="/get-your-case">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SupervisedUserCircleIcon />
            </ListItemIcon>
            <ListItemText primary="Get Your Case" />
          </ListItem>
        </Link>
        <Link to="/my-pay">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <MonetizationOnIcon />
            </ListItemIcon>
            <ListItemText primary="My Pay" />
          </ListItem>
        </Link>
        <Link to="/settings">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SettingsIcon />
            </ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
        </Link>
        <Link to="/log-out">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <ExitToAppIcon />
            </ListItemIcon>
            <ListItemText primary="Log Out" />
          </ListItem>
        </Link>
      </List>
    </div>
  );
}

export default Sidebar;
